function myFunction(x) {
	x.classList.toggle("change");
	$('.nav').slideToggle();
}

var clickSubMenu = 0;
$(".subnav-btn").click(function(){
 var target = $(this).parent().children(".subnav-content");
 // $(target).slideToggle();
 if(clickSubMenu == 0){
  $(target).slideDown(400);
  clickSubMenu = 1;
 }else{
  $(target).slideUp(400);
  clickSubMenu = 0;
 }
});

jQuery(function($) {
	// navhide on mobile
	var isMobile = navigator.userAgent.toLowerCase().match(/mobile/i);
	if (isMobile) {
		$('.subnav-content li a').on('click', function () {
			$('.nav').hide();
		});
		
	} else {
		// Do something
	}
});

